  `del_flag` int NULL DEFAULT NULL COMMENT '删除字段',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '资产分类表' ROW_FORMAT = DYNAMIC;

